import React, { Component } from "react";

class Post extends Component {
  render() {
    let post = this.props.post;
    return (
      <div className="post">
        {console.log(post)}
        <h2>Id: {post.id}</h2>
        <h2>Title: {post.title}</h2>
        <h2>Author: {post.author}</h2>
      </div>
    );
  }
}

export default Post;
